import pandas as pd
import matplotlib.pyplot as plt
import numpy as np


def getDateTickLabel(tradeDay_list: list, numOfTicks=5) -> (list, list):
    '''
    Give a trade day list and return xticks and xticklabels
    :param tradeDay_ls: list
    :return: (xticks, xticklabels)
    '''
    xticks = list()
    N = len(tradeDay_list)
    interval = N // numOfTicks
    for i in range(N):
        if i * interval < N:
            xticks.append(tradeDay_list[i * interval])
    xticklabels = xticks
    return (xticks, xticklabels)


def getBasis(name: str, future_dict: dict) -> pd.DataFrame:
    future_dict = pd.DataFrame.from_dict(future_dict["results"])
    future_dict.set_index("tradingDay", inplace=True)
    SP500 = pd.read_csv("^GSPC.csv")
    SP500.set_index("Date", inplace=True)
    basis = future_dict.close.sub(SP500.Close)
    std = np.std(basis)
    plt.plot(basis)
    xticks, xticklabels = getDateTickLabel(basis.index)
    plt.xticks(xticks, xticklabels)
    plt.title(name)
    plt.legend(["std: " + str(round(std, 2)), ])
    plt.savefig(name + "_Basis.png")
    plt.show()
    plt.close()

    plt.plot(SP500.Close)
    plt.plot(future_dict.close)
    xticks, xticklabels = getDateTickLabel(SP500.index)
    plt.xticks(xticks, xticklabels)
    plt.title(name)
    plt.legend(["S&P500", name + "_future"])
    plt.savefig(name + ".png")
    plt.show()
    plt.close()


